#include <stdio.h>
#include <stdint.h>

char *itobin(char *x, uint64_t num, uint8_t bit) {
  char *p = x;
  while (bit--) *x++ = ((num >> bit) & 1) + 48;
  *x = '\0';
  return p;
}

int main() {
  char buf[65];
  printf("%ld = %s
", 255ul, itobin(buf, 255ul, 8));
  printf("%ld = %s
", 123ul, itobin(buf, 123ul, 16));
  printf("%ld = %s
", 0xfffffffful, itobin(buf, 0xfffffffful, 32));
}

